import React, { Component } from 'react';
import logo from '../logo.svg';
import '../style/App.css';
import {
    BrowserRouter as Router,
    Route,
    Link
} from 'react-router-dom'
class App extends Component {
  render() {
    return (
      <div className="App">
          <h6>my first React</h6>
      </div>
    );
  }
}

export default App;
